import './logo.css';
import { GiBookmarklet  } from 'react-icons/gi';
import { NavLink } from 'react-router-dom';

const logo = () => {
    return (
        <NavLink to='/' className='logo'>
            <GiBookmarklet size={30} />
        </NavLink>
    )
}

export default logo
